The O module can be used to convert one-liners to full fledged programs. See perldoc: O for documentation. This is similar to -o option for GNU awk. Here's how -n and -p options are implemented. $ # note that input sources (stdin, filenames, etc) aren't needed here
$ perl -MO=Deparse -ne 'print if /at/'
LINE: while (defined($_ = readline ARGV)) { print $_ if /at/;
}
-e syntax OK $ perl -MO=Deparse -pe 's/ /:/g'
LINE: while (defined($_ = readline ARGV)) { s/ /:/g;
}
continue { die "-p destination: $!\n" unless print $_;
}
-e syntax OK Very useful to debug record separator scripts. $ perl -MO=Deparse -l -0072 -ne 'print if /a/'
BEGIN { $/ = ":"; $\ = "\n"; }
LINE: while (defined($_ = readline ARGV)) { chomp $_; print $_ if /a/;
}
-e syntax OK $ perl -MO=Deparse -00 -ne 'print if /it/'
BEGIN { $/ = ""; $\ = undef; }
LINE: while (defined($_ = readline ARGV)) { print $_ if /it/;
}
-e syntax OK Here's an alternate way to specify code to be executed after the while loop instead of using END block, when -n option is being used. This cannot be used with -p option because it will disrupt the continue block. $ perl -MO=Deparse -ne 'print if /4/ }{ print "==> the end\n"'
LINE: while (defined($_ = readline ARGV)) { print $_ if /4/;
}
{ print "==> the end\n";
}
-e syntax OK Here's an example of saving the script to a file instead of displaying on the terminal. $ perl -MO=Deparse -ne 'print if /4/' > script.pl
-e syntax OK
$ cat script.pl
LINE: while (defined($_ = readline ARGV)) { print $_ if /4/;
} $ perl script.pl table.txt
brown bread mat hair 42
yellow banana window shoes 3.14
